import React from 'react';
import './blocks.scss'

function Blocks() {
    return (
        <div className="ef-blocks fadeIn animated"
             data-anijs="if: scroll, on: window, do: fadeIn animated, before: $scrollReveal">
           
        </div>
    );
}

export default Blocks;
